this["JST"]["templates/account/welcome-admin.html"] = function(obj) {obj || (obj = {});var __t, __p = '', __e = _.escape, __j = Array.prototype.join;function print() { __p += __j.call(arguments, '') }with (obj) {__p += '<div class="jumbotron">\r\n    <h1>Welcome to LAMPA!</h1>\r\n    <p>LAMPA is a powerful, yet very user-friendly, set of tools for teachers, students and language schools. Once you\r\n        are all set up, it will save you time, it will facilitate lesson continuity, and it can help you supplement you\r\n        income.</p>\r\n    '; if (isAdmin()){ ;__p += '\r\n    <div class="well">\r\n        <p>\r\n            <strong>Step 1.</strong>\r\n            To use LAMPA to its full potential, you must set up six basic elements in the <strong><span\r\n                class="glyphicon glyphicon-cog"></span> SET UP</strong> menu:</p>\r\n        <ol>\r\n            <li><p>Set up your <strong data-toggle="tooltip" data-original-title="“School” is a broad term in LAMPA; it can be an actual school,\r\n                an agency, two or more teachers working together, or an individual teacher using LAMPA for their own teaching">school</strong>\r\n                by\r\n                checking or editing the information LAMPA has already filled in using your registration information and\r\n                add the\r\n                following:\r\n                <strong data-toggle="tooltip"\r\n                        data-original-title="This tells your timetable when the display should begin">School year starts\r\n                    on</strong>,\r\n                <strong data-toggle="tooltip"\r\n                        data-original-title="This tells you when your timetable display should stop">School year ends\r\n                    on</strong>,\r\n                <strong data-toggle="tooltip"\r\n                        data-original-title="This will be the default duration for a single lesson. It is important for calculating teaching hours, invoicing hours and lesson scheduling">Lesson\r\n                    duration</strong></p>\r\n            </li>\r\n            <li><p>Name and invite\r\n                <strong\r\n                        data-toggle="tooltip"\r\n                        data-original-title="If you are the only teacher, this has already been done for you, but you can edit it at any time or you\r\n                can add new teachers who start working with you later">teachers</strong></p>\r\n            </li>\r\n            <li><p>Define the various <strong data-toggle="tooltip"\r\n                                              data-original-title="One location has already been added for you, but you may edit the details at any time">locations</strong>\r\n                where you\r\n                expect lessons to take place, e.g. room numbers, firms,workstations for online lessons, etc.</p>\r\n            </li>\r\n            <li><p>Define the <strong data-toggle="tooltip" data-original-title="There is one course already set up for you to get you started,\r\n                but you may edit it and add others. In LAMPA, you need a minimum of one course and it is not necessary\r\n                to define it specifically,\r\n                but if you have a language school, for example, you may wish to add courses in various languages,\r\n                levels,\r\n                or specific subjects.">courses</strong> that you intend to teach</p>\r\n            </li>\r\n            <li><p>Designate your <strong data-toggle="tooltip"\r\n                                          data-original-title="One empty group has been set up to get you started, but you may edit it at anytime">groups</strong>,\r\n                i.e. individuals or classes taking a course at a given time and place</p>\r\n            </li>\r\n            <li><p>Name and invite your\r\n                <strong data-toggle="tooltip"\r\n                        data-original-title="In the near future, you will also be able to invite clients, e.g. human resource mangers, company representatives or guardians who are sponsoring the student’s learning">\r\n                    students\r\n                </strong> by\r\n                entering their names and emails\r\n            </p>\r\n            </li>\r\n        </ol>\r\n    </div>\r\n    <div class="well">\r\n        <p><strong>N.B.</strong>\r\n            <i>When setting up all other users, i.e. teachers, students or clients, it is important that you enter\r\n            their\r\n            email. LAMPA uses email addresses as unique user I.D.s, therefore this is essential in creating the user\r\n            account\r\n            and no two users may share the same email address.</i></p>\r\n    </div>\r\n    <div class="well">\r\n        <p><strong>Step 2.</strong>\r\n            After you have set up your basic elements, you can start adding lessons using the\r\n            <strong>Add</strong> feature in the <span class="glyphicon glyphicon-calendar"></span> <strong>MY\r\n                LESSONS</strong> menu.\r\n            Click on <strong>Add</strong> and do the following:</p>\r\n        <ol>\r\n            <li><p>Select the Group you would like to add to your timetable. If you have forgotten to add the\r\n                group, no worries, you can add a new group using the <strong>Add Group</strong> button on the right.</p>\r\n            </li>\r\n            <li><p>Use the calendar icon to select the date on which you would like to begin the course or add a\r\n                single lesson.</p>\r\n            </li>\r\n            <li><p>Choose an <strong>End Date</strong> for the course or last lesson, or select\r\n                <strong>By Lesson Count</strong> if you would prefer\r\n                to designate a specific number of lessons to be taught without a concrete end date.</p>\r\n            </li>\r\n            <li><p>Click Add Lessons and designate the day of the week, the start time, the duration, Teacher and\r\n                Location.</p></li>\r\n            <li><p>Repeat if the group is to have more than one lesson per week.</p></li>\r\n            <li><p>After all lessons for the group have been listed, click on <strong>Generate Lessons</strong></p>\r\n            </li>\r\n            <li><p>Check the list LAMPA has generated.If there are mistakes or lessons you wish to remove, you can\r\n                un-check the lessons using the check boxes at the right</p></li>\r\n            <li><p>Click on <strong>Save Lessons</strong></p></li>\r\n            <li><p>Click on the\r\n                <span class="glyphicon glyphicon-calendar"></span> <strong>MY LESSONS</strong>\r\n                menu and open a timetable to check them</p></li>\r\n            <li><p>Repeat to add lessons for other groups.</p></li>\r\n        </ol>\r\n    </div>\r\n    '; } ;__p += '\r\n    <div class="well">\r\n        <p>\r\n            '; if(isAdmin()){ ;__p += '<strong>Step 3.</strong> '; } ;__p += 'Don’t forget to invite other teachers and schools to become LAMPA partners and to\r\n            use LAMPA also!\r\n            The more teachers and students who use the system based on your initial invitation, the more you\r\n            can supplement your regular teaching income.\r\n            To invite teachers so that they can start using LAMPA’s tools for free, do the following:</p>\r\n        <ol>\r\n            <li><p>Click on <span class="glyphicon glyphicon-send"></span> <strong>INVITE PEERS</strong></p></li>\r\n            <li><p>Enter the teacher’s e-mail address</p></li>\r\n            <li><p>Personalize the invitation message</p></li>\r\n            <li>\r\n                <p>Click on\r\n                    <strong>Send</strong>\r\n                </p>\r\n            </li>\r\n        </ol>\r\n    </div>\r\n    <div class="well">\r\n        <h2>How can LAMPA supplement a partner’s income?</h2>\r\n        <p>LAMPA provides mobile learning games, personal dictionaries and course tracking tools for students.\r\n            When students download the app and buy a 1-year license, a portion of the purchase price goes directly back\r\n            to the teacher or school that has invited the student; another portion goes back to the teacher or the\r\n            school that\r\n            invited that teacher, and so on.\r\n            This is repeated on five levels. Simply, the more new users you invite, the more you can earn.</p>\r\n    </div>\r\n</div>\r\n\r\n\r\n\r\n';}return __p};

